import React from 'react';
import {
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    InputGroup,
    InputGroupAddon,
    InputGroupText,
    FormInput,
    Collapse
  } from "shards-react";

class Header extends React.Component{
  render() {
    return(
        <Navbar type="dark" theme="primary" expand="md">
         <NavbarBrand href="#">Shards React</NavbarBrand>
        </Navbar>

    )
  }
}

export default Header;
